import React, { Component } from "react";
//style importer
import * as s__ from "./style";
//component importer
import ComponentUser from "../ComponentUser/index";
//utils importer
//config importer
import * as config__ from "../../config/globtype";

type State = typeof initState;
const initState = {
  string: "Hello my friend" as string,
};
class MenuTop extends Component<{}, State> {
  state = initState;

  render() {
    return (
      <s__.Container style={{}}>
        <s__.HotLine>
					<p>{config__.HOT_LINE_PHONE}</p>
        </s__.HotLine>
        <s__.MiddleMenu>
          <s__.ContainerMenu>
            <s__.HeaderBtnMenu>
                <s__.LinkRoute to="/">Home</s__.LinkRoute>
              </s__.HeaderBtnMenu>
              <s__.HeaderBtnMenu>
                <s__.LinkRoute to="/about-us">About us</s__.LinkRoute>
              </s__.HeaderBtnMenu>
              <s__.HeaderBtnMenu>
                <s__.LinkRoute to="/documents">Docs</s__.LinkRoute>
              </s__.HeaderBtnMenu>
              <s__.HeaderBtnMenu>
                <s__.LinkRoute to="/git">Git</s__.LinkRoute>
            </s__.HeaderBtnMenu>
          </s__.ContainerMenu>
        </s__.MiddleMenu>
				<s__.UsersArea>

					<ComponentUser />

				</s__.UsersArea>
      </s__.Container>
    );
  }
}

export default MenuTop;
